import client from '../util/shopify-client'




const ItemList = () => {
    const [description,setDescription] = useState();

    client.product.fetchAll().then((products) => (
        products.map((item,i) => (

                setDescription(item.description)
        ))    
    ))
    return(
        <div>
            my list is {description}
        </div>
    )

}



const Store = () => {
    return(
        <div style={{
            position:"relative",
            top:"20vh"
        }}>
            Hello
            <ItemList />
        </div>
    )
}

export default Store;
